import React from "react";
import { styled } from "@mui/material/styles";
import { Grid } from "@mui/material";
import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";
import Typography from "@mui/material/Typography";
import { AdapterDateFns } from "@mui/x-date-pickers/AdapterDateFns";
import { LocalizationProvider } from "@mui/x-date-pickers/LocalizationProvider";
import { DatePicker } from "@mui/x-date-pickers/DatePicker";

import profileImage from "./img/rectangle11610.png";
import "./style/register.css";
import { flexbox } from "@mui/system";

const Register = () => {
  const [value, setValue] = React.useState(null);
  return (
    <Box className="page-body">
      <Box
        className="frame-register"
        sx={{
          display: "flex",
          flexDirection: "row",
        }}
      >
        <Box className="frame-img" sx={{ marginRight: "70px" }}>
          <div className="profile-img">
            <img src={profileImage} alt="img" />
          </div>
          <div className="profile-text">Изменить фото</div>
        </Box>
        <Box mt={4}>
          <Box
            sx={{
              display: "flex",

              alignItems: "baseline",
              marginBottom: "16px",
            }}
          >
            <Typography variant="body1" gutterBottom mr={6}>
              Firstname
            </Typography>
            <TextField
              id="outlined-basic"
              label="Enter firstname"
              variant="outlined"
              sx={{ width: 500 }}
            />
          </Box>
          <Box
            sx={{
              display: "flex",
              justifyContent: "space-between",
              alignItems: "baseline",
              marginBottom: "16px",
            }}
          >
            <Typography variant="body1" gutterBottom mr={6}>
              Surname
            </Typography>
            <TextField
              id="outlined-basic"
              label="Enter surname"
              variant="outlined"
              sx={{ width: 500 }}
            />
          </Box>
          <Box
            sx={{
              display: "flex",
              justifyContent: "space-between",
              alignItems: "baseline",
            }}
          >
            <Typography variant="body1" gutterBottom mr={6}>
              Birthday
            </Typography>

            <LocalizationProvider dateAdapter={AdapterDateFns}>
              <DatePicker
                label=" Enter birthday"
                value={value}
                onChange={(newValue) => {
                  setValue(newValue);
                }}
                renderInput={(params) => (
                  <TextField {...params} sx={{ width: 500 }} />
                )}
              />
            </LocalizationProvider>
          </Box>
        </Box>
      </Box>
    </Box>
  );
};

export default Register;
